import React from 'react'
import '../styles.css'

const RegistrationForm = () => {
  const [email, setEmail] = React.useState('')
  const [password, setPassword] = React.useState('')
  const [username, setUsername] = React.useState('')
  const [isFirstFormActive, setIsFirstFormActive] = React.useState(true)

  const handleEmailChange = (event) => {
    setEmail(event.target.value)
  }

  const handlePasswordChange = (event) => {
    setPassword(event.target.value)
  }

  const handleUsernameChange = (event) => {
    setUsername(event.target.value)
  }

  const handleFormToggle = () => {
    setIsFirstFormActive(!isFirstFormActive)
  }

  const handleSubmit = (event) => {
    event.preventDefault()
    // Здесь нужно добавить логику отправки данных на сервер
    console.log('Email:', email)
    console.log('Password:', password)
    console.log('Username:', username)
  }

  return (
    <div className="registration-container">
      <div className="background-images">
        <img
          className="heart-bottle"
          src="./beer-pics/heart_bottle.png"
          alt="heart-bottle"
        />
        <img className="bubblz" src="./beer-pics/bubblz.png" alt="bubblz" />
        <img className="cap" src="./beer-pics/cap.png" alt="cap" />
        <img className="cap2" src="./beer-pics/cap2.png" alt="cap2" />
      </div>
      <div className="registration-window">
        <h2>{isFirstFormActive ? 'Registration' : 'Additional Information'}</h2>
        {isFirstFormActive ? (
          <form onSubmit={handleSubmit}>
            <div className="input-group">
              <label htmlFor="email">Email:</label>
              <input
                type="email"
                id="email"
                value={email}
                onChange={handleEmailChange}
                required
              />
            </div>
            <div className="input-group">
              <label htmlFor="password">Password:</label>
              <input
                type="password"
                id="password"
                value={password}
                onChange={handlePasswordChange}
                required
              />
            </div>
            <button type="submit" className="custom-button">
              <img
                height={45}
                width={16}
                src="./beer-pics/beer-button.png"
                alt="beer-button"
              />
              <img
                height={45}
                width={45}
                src="./beer-pics/bottle-opener-full.png"
                alt="bottle-opener"
              />
            </button>
          </form>
        ) : (
          <form>
            <div className="input-group">
              <label htmlFor="username">Username:</label>
              <input
                type="text"
                id="username"
                value={username}
                onChange={handleUsernameChange}
                required
              />
            </div>
            <div className="input-group">
              <label htmlFor="email">Email:</label>
              <input
                type="email"
                id="email"
                value={email}
                onChange={handleEmailChange}
                required
              />
            </div>
            <div className="input-group">
              <label htmlFor="password">Password:</label>
              <input
                type="password"
                id="password"
                value={password}
                onChange={handlePasswordChange}
                required
              />
            </div>
            <button type="submit" className="custom-button">
              <img
                height={45}
                width={16}
                src="./beer-pics/beer-button.png"
                alt="beer-button"
              />
              <img
                height={45}
                width={45}
                src="./beer-pics/bottle-opener-full.png"
                alt="bottle-opener"
              />
            </button>
          </form>
        )}
        <button onClick={handleFormToggle} className="toggle-button">
          {isFirstFormActive ? 'Next' : 'Back'}
        </button>
      </div>
    </div>
  )
}

export default RegistrationForm
